import React from 'react';
import { Container,  Row, Col, Carousel, Image, Caption, Nav, Navbar, Collapse } from 'react-bootstrap';

import headerImg from '../assets/images/donate-img.jpg';

class Header extends React.Component {
    render() {
        return (
            <header>
                  <Navbar expand="lg">
                      {/* <Navbar.Brand href="/">Blood-Sharing</Navbar.Brand> */}
                      <Navbar.Toggle aria-controls="basic-navbar-nav" />
                          <Nav className="nav-link">
                              <Nav.Link href="/">Home</Nav.Link>

                              {this.props.currentUser.id !== undefined && (     
                              <React.Fragment>
                                 <Nav.Link href="/donate">Donate</Nav.Link><Nav.Link href="/blood/request">Request</Nav.Link>
                              </React.Fragment>
                            )}
                          </Nav>
                          <Nav className="nav-link m-auto">
                            <Nav.Link href="/" className="main-logo">Blood Sharing</Nav.Link>
                          </Nav>

                          <Nav className="ml-auto">
                              <Nav.Link href="/register">Register</Nav.Link>
                              <Nav.Link href="/login">Login</Nav.Link>
                          </Nav>

                      {/* </Navbar.Collapse> */}
                  </Navbar>

                <div className="header-img">
                    <img src={headerImg}/>
                </div>
            </header>
        );
    }
}
export default Header;
